Q13) Draw the linked list after executing the following code:

Initial List: `Head -> 4 -> 7 -> 8 -> 6 -> 3 -> NULL`

```java
public void DoSomthing3() {
    node t1 = Head;
    while (t1 != null) {
        if (t1.data % 3 == 0) {
            node nn = new node();
            nn.data = t1.data - 1;
            nn.next = t1.next;
            t1.next = nn;
            t1 = nn; // Advance to the new node to avoid processing it in the next loop
        }
        t1 = t1.next;
    }
}
```
